import styled, { keyframes } from 'styled-components'

const popup = keyframes`
from {
opacity: 0;
}

to {
    opacity: 1;
}
`;

export const TileContainer = styled.div`
    width: 960px;
    min-height: 100%;
    display: flex;
    align-content: flex-start;
    flex-wrap: wrap;
`;

export const Button = styled.button`
    display: block;
    width: 40px;
    height: 40px;
    position: fixed;
    top: 80%;
    left: 90%;
`;
